// React Router version 6:

import { BrowserRouter, Routes, Route } from 'react-router-dom';

const App = () => {
  return (
    <>
      <div className="App">
        <BrowserRouter>
          <Routes>
            <Route path="/home" element={<h1>Home Page</h1>} />
          </Routes>
        </BrowserRouter>
      </div>
    </>
  );
};

export default App;
